植物育成ＬＥＤライト300Ｗ 6波長 水耕栽培・植物栽培が可能です。<BR>
<BR>
大型ファンや実際の育成データによる独自のLED配列を採用し、全く<BR>
<BR>
太陽に当てなくても育成することが可能です。<BR>
<BR>
<BR>【仕様】<BR>
<BR>
電圧：AC85V-265V（100V電源でお使いいただけます）<BR>
・LED球：3w x 100球<BR>
・ルーメン：8000lu<BR>
・寿命：50000時間-10000時間<BR>
・本体サイズ： 310mm x 210mm x 72mm<BR>
・LED視野角:90/120°<BR>
・LED6波長<BR>
<BR>
【送料無料】【限定3個】<BR>

<BR>
※注文個数によりお届け日が変わることがあります。<BR>
<BR>
【1～2日以内に発送予定】<BR>

<BR>
★注意事項★<BR>
